"use client";
import { FaGoogle } from 'react-icons/fa';
import Image from 'next/image';
import { useEffect, useState } from 'react';
import axios from 'axios';
import { useRouter } from 'next/navigation';
import Cookies from 'js-cookie';
import { MdErrorOutline } from "react-icons/md";
import { FiEye } from "react-icons/fi";
import { FiEyeOff } from "react-icons/fi";
// import { useUserContext } from "@/context/userContext";

export default function Login() {
    const router = useRouter();
    const [loginData, setLoginData] = useState({});

    const [isLoggedIn, setIsLoggedIn] = useState(false);
    function setLogin() {
        if (isLoggedIn) {
            setIsLoggedIn(false);
        } else {
            setIsLoggedIn(true);
        }
    };

    const [loginFailed, setLoginFailed] = useState(false);
    const [firstTry, setFirstTry] = useState();

    useEffect(() => setFirstTry(true), []);

    const updateLoginData = (e) => {
        setLoginData({ ...loginData, [e.target.name]: e.target.value });
    }

    const handleLogin = async (e) => {
        // setLogin();
        setLoginFailed(false);
        setFirstTry(false);
        e.preventDefault();

        try {
            setIsLoggedIn(true);
            const data = {
                username: loginData['username'],
                password: loginData['password']
            }

            const headers = {
                'api-key': `${process.env.NEXT_PUBLIC_API_KEY}`,
            }

            const res = await axios.post(`${process.env.NEXT_PUBLIC_SERVER}/user/authenticate`, data, { headers });

            if (res.status == 200 || res.status == 201) {
                // setUsername(res.data['username']);
                // setCompanyName(res.data['company_name']);
                // setCompanyId(res.data['company_id']);
                if (!res.data['token']) {
                    throw new Error('Login failed');
                }
                // console.log(res.data);
                setLoginFailed(false);

                const in300mins = new Date(new Date().getTime() + 300 * 60 * 1000);
                Cookies.set('authToken', res.data['token'], { expires: in300mins });
                Cookies.set('username', res.data['username'], { expires: in300mins });
                Cookies.set('companyId', res.data['company_id'], { expires: in300mins });
                Cookies.set('companyName', res.data['company_name'], { expires: in300mins });
                router.push("/home");

                // localStorage.setItem('authToken', res.data['token']);
            } else {
                console.log(res.data);
            }
        } catch (err) {
            setIsLoggedIn(false);
            setLoginFailed(true);
            console.log(err);
        }
    }


    const [passwordVisible, setPasswordVisible] = useState(false);

    return (
        <>{
            loginFailed && <div className="toast toast-top toast-start ml-12 mt-4">
                <div className="alert alert-error">
                    <MdErrorOutline />Incorrect credentials.
                </div>
            </div>
        }
            <div className="grid grid-cols-2 gap-40 justify-center content-center h-screen bg-black px-16 bg-custom-gradient">
                <div className='flex flex-col items-center'>
                    <div className='w-4/6'>
                        <LogoSvg />
                    </div>
                    <form className=' text-black flex flex-col bg-white gap-10 justify-center w-full h-626 rounded-2xl border-2 border-black p-10  font-poppins ' onSubmit={handleLogin}>
                        {/* <div className="self-center text-3xl font-medium leading-51 tracking-wider">Log in to BuzzTrends</div> */}
                        {/* <div className="self-center text-base font-normal leading-5 tracking-wide">Please enter your details</div> */}


                        <div >
                            <label htmlFor="username" className='text-base font-medium leading-5 tracking-wide'>Username</label><br></br>
                            <input type='text' id="username" name="username" placeholder='Enter your username' className='mt-2 h-[49.58px] rounded-[12px] border-[1px] w-full p-4 placeholder-base placeholder-light placeholder-leading-5 placeholder-tracking-wide' onChange={updateLoginData}></input>
                        </div>

                        <div>
                            <label htmlFor="password" className='text-base font-medium leading-5 tracking-wide'>Password</label>
                            <div className='flex items-center gap-2 border-[1px] rounded-[12px] focus-within:border-black focus-within:border-2'>
                                <input type={`${passwordVisible ? 'text' : 'password'}`} id="password" name="password" placeholder='Enter your password' className='h-[49.58px] rounded-[12px] w-full p-4 placeholder-base placeholder-light placeholder-leading-5 placeholder-tracking-wide focus:outline-none' onChange={updateLoginData}></input>
                                <span className='mr-4' onClick={() => setPasswordVisible(!passwordVisible)}>
                                    {
                                        passwordVisible ? <FiEye size={22} /> : <FiEyeOff size={22} color='#d3d3d3' />
                                    }
                                </span>
                            </div>
                        </div>

                        {/* <div className='flex justify-between text-xs font-medium leading-4 tracking-wide'>
        
          <div className="remember">
          <input type="checkbox" id="remember-me" />
          <label htmlFor="remember-me"> Remember me</label>
          </div>

          <div className="forgot-password">
            Forgot password
          </div>


       </div> */}

                        <button className='w-full bg-linear-gradient h-[56px] rounded-[12px] border-2 text-base font-medium leading-33 tracking-wide text-white flex items-center justify-center' type='submit'>
                            {!isLoggedIn && <span>Sign in</span>}
                            {isLoggedIn && <span className="loading loading-bars loading-md"></span>}
                        </button>

                        {/* <div className="self-center">OR</div>

        <button className="self-center flex justify-center gap-5 items-center h-[56px] rounded-[12px] border-2 w-full" >
          <FaGoogle />
          <span>Sign in with Google</span>
        </button> */}
                    </form>
                </div>

                <div className='mt-14'>
                    <BgSvg />
                </div>

            </div>
        </>
    );
};


